insert into tblCS_Review values(1, '지원동기, 희망 업무와 관련하여 구체적으로 작성해야합니다!', '많은 프로젝트를 해보는게 좋은 것 같습니다.', 1);
insert into tblCS_Review values(2, 'IT개발 관련 프로젝트 및 학습(논문, 공모전, 이수과목 등) 과정에서 본인이 맡은 역할에 대해 준비하시면 좋을거같아요!', '너무 어려운 것에 목매지 말고 기초적인 것부터 천천히 다시 보세요.', 2);
insert into tblCS_Review values(3, '팀 프로젝트를 성공적으로 이끌어 내기 위해 가장 중요한 요소가 무엇인지 생각하는지 본인의 경험을 작성하는게 좋아요!', '복지가 맘에 들어요.', 3);
insert into tblCS_Review values(4, '코딩테스트를 진행하는데, 미리 공부한 내용을 다시한번 공부해보면 좋을거같아요!', '기존의 코드를 리팩토링하는 작업을 반복하였습니다.', 4);
insert into tblCS_Review values(5, '운영체제에 대한 전반적인 이야기를 했어요! 미리 준비하시면 좋을거같아요!', '비전공자인 제가 노력을 해서 회사에 잘 입사한 것 같습니다.', 5);
insert into tblCS_Review values(6, '일반 면접 후, 인적성 면접을 따로 봤어요!', '복지가 맘에 들어요.', 6);
insert into tblCS_Review values(7, 'PT면접을 봤는데, 회사에서 준 종이에 이슈가 적혀있는데, 그 이슈에 대해 종이에 정리하여 30분간 준비 후, 발표했어요!', '일이 어렵지만 재밌습니다.', 7);
insert into tblCS_Review values(8, 'DB, SQL에 대한 일반적인 상식을 복습하면 좋을거같아요!', '취업을 하고도 공부하는 것이 매우 중요한 것 같습니다.', 8);
insert into tblCS_Review values(9, '5명이 들어가서 50분 정도 면접을 봤고, 한 사람당 대략 10분정도 진행했으며, 초반 자기소게 + 마지막 하고싶은 말을 제외하면 질문 시간은 거의 4~5분 정도 였던거같아요!', '개인 공부를 진행하는 것이 좋습니다.', 9);
insert into tblCS_Review values(10, '면접을 보러갈 회사에 대해 미리 인재상, 기업 정보를 확인하시고 가면 좋아요!', '원하는 기업에 다니게 되어 매우 좋습니다.', 10);
