insert into tblCS_Review values(14, '자기소개를 계속 준비하시는게 좋아요.', '회사 문화가 맘에 들어요', 14);
insert into tblCS_Review values(15, '다대다 직무면접을 봤어요. ', '복지가 맘에 들어요.', 15);
insert into tblCS_Review values(16, '앞으로의 진로계획에 대해 물어봤으며, 이 기업을 통해 얻고자 하는것이 무엇인지를 물어보셨습니다.', '야근을 자주 하고있습니다.', 16);
insert into tblCS_Review values(17, '자신이 조직을 위해서 희생한 경험을 물어보셨으며, 어떻게 앞으로 나아갔는지 물어보셨습니다.', '사수분이 매우 친절하며 저도 함께 성장중입니다.', 17);
insert into tblCS_Review values(18, '너무 떨지 않으셔도됩니다. 하지만 궁금한 점이 있으면 꼭 물어보세요!', '바로 실무에 투입되지는 않고 회사에서 다시 배우고있습니다.', 18);
insert into tblCS_Review values(19, '자신있는 프로그램 언어와 그 언어로 통한 프로그래밍 경험에 대해 물어보셨어요.', '사이드 프로젝트를 만들며 커리어를 쌓고 있습니다.', 19);
