insert into tblCS_Review values(21, '자기소개서 기반으로 프로젝트 질문을 하셔서 자기가 제작한 프로젝트를 다시한번 확인 해보시고 가면 좋을거같아요!', '기존에 배운 것에 더해 개인적으로 도서를 구매해 깊은 이해를 가질려고 노력하고있어요.', 21);
insert into tblCS_Review values(22, '장기적으로 개발한 프로젝트가 있는지 물어보셨습니다.', '기존의 코드를 리팩토링하는 작업을 반복하였습니다.', 22);
insert into tblCS_Review values(23, '팀 내 동료와 의견이 안맞을 경우 어떻게 풀어가셨는지 물어보셨습니다.', '회사를 다니며 수면시간이 규칙적이지 않게 되었습니다.', 23);
insert into tblCS_Review values(24, '학부 시절 가장 재미있던 과목을 물어보셨고, 그 이유를 물어보셨습니다.', '아직 회사에 들어간지 얼마 되지 않아 기존의 코드를 보며 공부중입니다.', 24);
insert into tblCS_Review values(25, 'DB에서의 트랜잭션, 무결성, 외래키에 대해서 설명하도록 시키셨습니다.', '취업하여 잘 다니고 있습니다. 확실히 사수분이 좋으신분을 만나 좋습니다.', 25);
insert into tblCS_Review values(26, null, null, 26);
insert into tblCS_Review values(27, '입사한다면 하고싶은일이 있는지 물어보셨습니다!', '다니고 있는 회사에 상사분들에 본받아 열심히 해야겠다는 느낌을 받습니다.', 27);
insert into tblCS_Review values(28, '해당 기업의 부서에 도움을 줄 수 있는 부분과 해당 부서가 하는일에 대해 물어보셨습니다.', '원하는 조건에 제가 원하는 기업에 열심히 다니고 있습니다.', 28);
insert into tblCS_Review values(29, '자사의 홈페이지를 본적이 있는지 물어보셨고, 고칠 점이 있는지 물어보셨습니다.', '회사 분위기가 매우 좋아서 좋습니다.', 29);
insert into tblCS_Review values(30, 'DB에서 join과 연계하여 심층적으로 물어보셨습니다.', '회사 문화에 적응하기 위해 노력중입니다.', 30);
insert into tblCS_Review values(31, '필기 시험을 봤습니다. 필기시험은 5과목이었으며 Java, JSP, DB, WEB UI, Framework로 10문제 시험봤습니다.', '전공자인 제가 먼저 취업할 수 있게 도와준 학원에 감사합니다.', 31);
insert into tblCS_Review values(32, null, null, 32);
insert into tblCS_Review values(33, '기업에서 가장 중요한게 뭐라고 생각하는지 물어봤어요. 잘 대답하시면 좋은 점수를 주실거같아요.', '비전공자인 제가 노력을 해서 회사에 잘 입사한 것 같습니다.', 33);
insert into tblCS_Review values(34, '10년 후 자신의 모습은 어떨지 물어보셨어요.. 면접 전에 한번 나자신에 대해 생각해보면 좋을거같아요.', '스터디를 하며 업무 외에도 저의 실력을 키워야 겠다고 생각합니다.', 34);
insert into tblCS_Review values(35, '취미생활은 뭔지, 좋아하는 것은 무엇인지 사소하게 물어봐요. 아마도 분위기 전환용으로 물어보시는거같아요!', '현재 회사에 다니면서 경험을 쌓고 있습니다. 저도 함께 성장하는 것 같습니다.', 35);
insert into tblCS_Review values(36, '프로젝트에 투입될 경우 어떤 방식으로, 어디에 투입되는지 물어보는것도 좋을 거같아요!', '회사 다니기 전의 저의 코딩 스타일, 장단점이 회사를 다니게되면서 어떤지 알 수 있었습니다.', 36);
insert into tblCS_Review values(37, null, null ,37);
insert into tblCS_Review values(38, '자바의 특징과 장점을 알면 좋을거같아요! 면접 때 질문하셨어요.', '회사에 다니면서 저의 목표를 정해서 계획을 세우며 공부하고있습니다.', 38);
insert into tblCS_Review values(39, '다양한 회사에 면접을 보면서 면접 실력을 기르는 것도 좋을 거같아요!', '회사를 다니면서 저만의 서비스를 꼭 운영해보고 싶다는 생각이 들었습니다.', 39);
insert into tblCS_Review values(40, '현재 IT 기술의 흐름을 알고 면접을 보시면 도움되실거같아요!', '출근 전 30분동안 사이드 프로젝트를 진행하고, 퇴근 후에도 1시간동안 사이드 프로젝트를 진행중입니다. ', 40);
insert into tblCS_Review values(41, '지금까지한 코딩 공부에 대해 물어보셨어요! 면접전에 내가 무슨 공부를 했고 어떻게 공부 과정을 진행하였는지 정리해보세요!', '기본적인 객체지향에 대한 공부를 다시 진행하며 복습하고 있습니다. 도움이 되는 것 같아요.', 41);
insert into tblCS_Review values(42, '조금 유명한 곳에서 면접을 봤는데, 간단한 코딩테스트와 면접을 진행하였습니다.', '어떻게 하면 클린코드를 작성할 수 있을지 고민하면서 개발중입니다.', 42);
insert into tblCS_Review values(43, '사전 기술테스트를 진행하였는데, 실제 면접 전에 태블릿PC로 Spring, Java 기초적인 기술테스트를 보았습니다.', '인덱스 생성과  SQL 작성 노하우라는 책을 읽으면서 공부하고있습니다.', 43);
insert into tblCS_Review values(44, '개발 공부는 언제부터 시작했고, 어려운지여쭤보였습니다.', '마음가짐이 중요한 것같습니다. 매번 깊게 공부하고, 열심히 하며 공부하다보니 좋은 결과를 얻은 것 같습니다.', 44);
insert into tblCS_Review values(45, null, null, 45);
insert into tblCS_Review values(46, '직무에 관한 면접 뿐만아니라, 일상생활에서의 문제와 대입하여 어떻게 해결할 것인지 물어봤습니다.', '트랜잭션, 락, 인덱스, 3way handshake 등의 기본적인 CS지식에 대해 공부하려고 노력중입니다.', 46);
insert into tblCS_Review values(47, 'http와 https의 차이점을 물어보셨습니다.', '지금도 학원에서 배운 것을 토대로 복습하고있습니다. 많은 도움이 됩니다.', 47);
insert into tblCS_Review values(48, 'SQL Developer, MySQL이 무엇인지 아는지 물어봤습니다.', '다른 회사로 이직하기위해 코딩테스트와 포트폴리오를 준비하고있습니다.', 48);
insert into tblCS_Review values(49, '구글 크롬에서 개발자 도구로 들어가기 위한 펑션키는 무엇인지 물어보셨습니다.', '네트워크와 데이터베이스에 관련된 내용이 백엔드 개발에 대해 중요한 지식이 되는 것같습니다.', 49);
insert into tblCS_Review values(50, '실제 웹사이트를 직접 제작해본 경험이 있는지 물어보셨습니다.(서버 세팅 부터 론칭까지)', '주요 디자인 패턴에 대해 공부를 하는 것이 좋은 것 같습니다.', 50);
insert into tblCS_Review values(51, '사이트 홍보, 사이트 개발, 사이트 운영중에서 가장 중요한 것이 무엇인지 물어보셨습니다.', '요즘은 쉴때에도 제 개인적인 사이드 프로젝트를 진행하고있습니다. 확실히 제 개발향상에 도움이 되는 것 같습니다.', 51);
insert into tblCS_Review values(52, '스토리 보드는 어떤 툴을 이용하였는지 물어보셨습니다.', '공부를 할 때 직접 손으로 작성하면서도 공부하고 있는데, 저만의 방식으로 작성하게 되어 나중에 기억하기 편한 것 같습니다.', 52);
insert into tblCS_Review values(53, '당사가 가지고 있는 비즈니스 모델이 무엇인지 물어보며 개선되었으면 하는부분에 대해 물어보셨습니다.', '현재 다니고 있는 회사가 마음에 들지 않아 이직을 준비중입니다.', 53);
insert into tblCS_Review values(54, null, null, 54);
insert into tblCS_Review values(55, '프로젝트 진행 당시에 겪었던 어려움과, 기술적인 부분은 어떤방식으로 해결하였는지 설명했습니다.', '컴퓨터 전공지식(운영체제, 네트워크, DB등)을 다시한번 공부하며 도움이 많이 되었습니다.', 55);
insert into tblCS_Review values(56, '시간 복잡도와 공간 복잡도에 대해 질문하였습니다.', '취업 후 제가 작성한 코드에 대한 일관성을 가지고, 설명을 할 수 있도록 작성하면서 성장하고있습니다.', 56);
insert into tblCS_Review values(57, '어떤 개발자가 되고싶은지 물어보았습니다. 면접 보시기 전에 자신은 어떤 모습이 되고 싶은지 생각해보고 가시면 좋을거 같습니다.', '취업을 하고, 꾸준히 공부하며 제대로 학습하는 것이 도움이되는 것 같습니다.', 57);
insert into tblCS_Review values(58, 'Stack과 Queue의 특징에 대해 물어보셨습니다.', '취업한 기업의 기술 스택을 공부하며, 코드리뷰를 통해 많은 도움이 되고 있습니다.', 58);
insert into tblCS_Review values(59, null, null, 59);
insert into tblCS_Review values(60, '합격하게 된다면 개발자로서의 자세를 물어보셨습니다.', 'IT기술 자격증이 있어서 취업하는 데 도움이 되었습니다.', 60);
insert into tblCS_Review values(61, '가장 잘 아는 개발 방법론이 무엇인지 물어보셨습니다.', '좀 더 학습과 경험을 통해서 기술과 능력을 향상시키기 위해 어떻게 목표를 잡아야할 지 준비하고 있습니다.', 61);
insert into tblCS_Review values(62, 'SW 개발중에 문제가 발생하였을 때 어떻게 해결하는지 물어보셨습니다. 아마도 저의 문제 해결 능력을 파악하실려고 물어보신거 같아요.', '해당 업무에 스킬도 중요하지만, 경험도 중요한 것 같습니다. 어떤일이 발생했을 때 어떻게 처리해야하는지 많은 경험을 배우고 있습니다.', 62);
insert into tblCS_Review values(63, '애플리케이션에서 버그를 찾아 테스트하는 저만의 프로세스가 있는지 물어보셨습니다.', '제가 프로젝트를 만들며 설계한 목적과 이유, 어떤 과정에서 어떤 문제가 있었고, 어떻게 해결했는지에 대해 설명을 잘 할 수 있도록 천천히 공부하고 있습니다.', 63);
insert into tblCS_Review values(64, '코딩에서 가장 흥미로운 점을 물어보시며 어떤 경우에 재미를 느끼는지 물어보셨습니다.', '가고싶었던 회사와 관련된 프로젝트를 만들며 진입장벽을 낮춰보는 것도 도움이 되었습니다.', 64);
insert into tblCS_Review values(65, '자신이 잘했다고 생각하는 프로젝트에 대해 질문 하였으며, 어떤 역할과 다른 팀원을 어떻게 도왔는지 질문하였습니다.', '코드리뷰를 하며 저의 코드 문제점과 어떻게 고치면 좋을지 가르쳐주셔서 좋습니다.', 65);
